export default function Scorecard({playerScore, computerScore}){
    return(
        <div className='scorecard'>
            <h1>Scorecard</h1>
            <div className = 'scores'>
                <p>Player: {playerScore}</p>
                <p>Computer: {computerScore}</p>
            </div>
        </div>
    ); 
}
